import React, { useEffect } from 'react'
import { getGraphData } from '../api'

function GraphChart() {
    useEffect(() => {
        getGraphData()
            .then(res => {
                console.log("Graph data")
                console.log(res)
            })
    }, [])
  return (
    <div>GraphChart</div>
  )
}

export default GraphChart
